INSERT INTO `announcements` (`id`, `announcement`) VALUES
(1, '<!--\n	<span style="font-size:16px;"><span style="color: rgb(0, 128, 128); "><span style="background-color: rgb(240, 255, 255); ">Time to Say goodbye to the starving artist mentality!!! </span></span></span>There is a <a href="/gymsignup/MoneySeminar.htm" target="_new">Money Seminar</a> coming to the gym on August 9th. <a href="/gymsignup/MoneySeminar.htm" target="_new">Click here</a> to learn more.</p>\n<p>\n-->\n<p>\n	 </p>\n<p>\n	<strong style="font-size: 14px; ">For Information on JJGym please see "<a href="http://www.jjgym.com/gym2.htm">More Info</a>" and "<a href="http://www.jjgym.com/faq.htm">FAQ</a>".</strong></p>\n<p>\n	<span style="font-size: 16px; "><span style="color: rgb(255, 0, 0); "><span style="color: rgb(0, 0, 0); "><strong>PARKING:  </strong></span></span></span><span class="Apple-style-span" style="font-size: 14px; ">1. Please park at the park on Erwin Street. However, if you are coming late at night, pay attention to the signs at the park. 2. If for any reason you cannot park at the park, please do not block walkways or driveways. Specifically, do not park in front of the daycare across the the street or in front of the house directly across the street from us.  3. Leave room so others can park in front of or behind you. (Don''t take up 2 spaces!) </span></p>\n<p>\n	<span style="font-size: 14px; ">TO JOIN AN AERIAL CLASS: contact Kerry Wee 818-255-8699 or Sarah Romanowsky, sarahromanowsky@yahoo.com</span></p>\n<p>\n	<span style="font-size:14px;"><strong><span style="color: rgb(255, 0, 0); ">If you are teaching a class in the gym, please describe your class on the schedule and contact Jeri for expected rental fees. </span></strong></span></p>\n<p>\n	<span style="font-size:14px;"><span style="color: blue; "><span style="color: rgb(75, 0, 130); "><strong>To reserve 100% of the gym</strong> for a private session, please contact Jeri</span></span><span class="Apple-style-span" style="color: rgb(75, 0, 130); "> for rates and availability</span><span class="Apple-style-span" style="color: blue; "><span style="color: rgb(75, 0, 130); "><span class="Apple-style-span" style="font-weight: normal; ">: 661-713-3141 or </span></span><span class="Apple-style-span" style="color: rgb(75, 0, 130); font-weight: normal; ">jeri@kalvan.net. </span></span><span style="color: rgb(75, 0, 130); font-weight: normal; ">If you have booked 100% before, you may book the space, then please notify Jeri of the date and time. </span></span></p>\n<h2>\n	<span style="font-size:16px;"><span style="color: rgb(255, 0, 0); "><span class="Apple-style-span" style="font-weight: normal; ">*** Please cancel your gym reservation asap if you are not going to be here.  If you do not cancel with at least 24 hours notice, please consider making a donation for the time you reserved.</span></span></span></h2>\n<p>\n	<span style="font-size:14px;"><span style="color: rgb(128, 0, 128); "><strong> </strong></span></span></p>\n<h3 style="color: blue;">\n	<strong style="color: rgb(128, 0, 128); ">Thank You. We love you</strong><span style="color: rgb(128, 0, 128); ">!</span></h3>\n<p>\n	<span _fck_bookmark="1" style="display: none; "> </span></p>\n'),
(2, '<p>\n	Hello test</p>\n');
